(345, 52, 52, 12, 'Immediately touch base with the other team members to find out who is the fastest at each of the manufacturing stations, and allocate tasks among you accordingly', '5', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22');
INSERT INTO `responses` (`id`, `group_tasks_id`, `individual_tasks_id`, `user_id`, `prompt`, `response`, `correct`, `points`, `created_at`, `updated_at`) VALUES
(346, 52, 52, 12, 'Avoid being overly assertive in the new team and let others determine the team’s direction, because it is important that the younger members take the lead.', '1', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(347, 52, 52, 12, 'Quickly decide to continue with your planned production schedule because it probably won''t be possible to meet the rush order deadline.', '1', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(348, 52, 52, 12, 'Quickly meet with your team members to decide the priority that should be given to the "rush order".', '3', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(349, 52, 52, 12, 'Meet with each of the team members, encouraging them and clarifying what each will have to do in order to reach the deadline.', '5', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(350, 52, 52, 12, 'Gather the team together and map out a realistic timeline of what must be accomplished in order for the rush shipment to be completed.', '5', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(351, 52, 52, 12, 'Help the team stay calm by letting them know that they shouldn’t be too stressed about meeting the deadline because Sales knew that it was an unrealistic deadline when they made the commitment.', '1', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(352, 52, 52, 12, 'Try not to react too strongly to the news to help the new team members understand that this kind of rush order occurs far too often.', '1', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(353, 52, 52, 12, 'Let the team know that although you have not produced an order so quickly in the past, you are confident that by staying focused your team can ship the rush order on time.', '5', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(354, 52, 52, 12, 'Suggest that the deadline is unreasonable, and you will simply have to do your best without worrying about meeting the unrealistic shipment date to which the Sales department committed themselves.', '1', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(355, 52, 52, 12, 'Highlight the fact that you have been doing the job for 15 years and the current layout is the best one.', '1', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(356, 52, 52, 12, 'Propose that a good strategy may be to think outside of the box and get new layout ideas from high performance manufacturers in other industries.', '5', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(357, 52, 52, 12, 'Keep the team on track by pointing out that it is very inefficient to waste time discussing solutions that are probably not practically feasible.', '1', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(358, 52, 52, 12, 'Suggest that the team keep the ideas similar to the current layout to simplify the transition to the new building.', '1', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(359, 52, 52, 12, 'Suggest that to find the optimal layout, the team should first generate innovative ideas and save the evaluation of the ideas for later in the process.', '1', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(360, 52, 52, 12, 'Make sure the team doesn’t waste time discussing drastic changes to the current layout because management is not likely to endorse such a proposal anyway.', '1', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(361, 52, 52, 12, 'Make sure production levels don’t drop due to letting your team’s most creative member make all suggestions.', '5', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(362, 52, 52, 12, 'Remind the team that they have been working in the current environment for many years, and should consider all layout options even if they seem unfamiliar.', '5', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(363, 52, 52, 12, 'Recommend that each team member take time this week to create three layout designs and bring them to the next team meeting.', '5', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(364, 52, 52, 12, 'Suggest that a good way to generate innovative layouts would be to hold the next meeting in the new building.', '5', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(365, 52, 52, 12, 'Make sure the team knows of potential risks and that it is critical that you are able to check for damage to the machine before any recommendation is made.', '5', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(366, 52, 52, 12, 'Support your team members in their decision, you’ve worked together for a long time, and trust their judgment.', '1', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(367, 52, 52, 12, 'Make sure the machine gets the job done on schedule by accepting the judgment of your experienced teammates.', '1', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(368, 52, 52, 12, 'Acknowledge that it’s likely that the electrical systems have not been damaged, but insist that you be given a chance to inspect the machine’s structural soundness yourself.', '5', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(369, 52, 52, 12, 'Tell the team about your experiences with similar accidents in the past and ask that you be able to inspect the machine personally before the recommendation is made.', '5', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(370, 52, 52, 12, 'Recommend that they go ahead and run the machine to support your team and then check its structural soundness after the important production run is finished.', '1', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(371, 52, 52, 12, 'Relate to the team some additional areas of potential damage to the machine after inquiring into the inspections they have made.', '5', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(372, 52, 52, 12, 'Although you are more experienced in the structural mechanics, go with the judgment made by your teammates because two of them have been with the company much longer than you have.', '1', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(373, 52, 52, 12, 'Thank the team for checking the machine over, but relate to the team your experience with "unseen damage" occurring even when it is not evident from an outside glance.', '5', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(374, 52, 52, 12, 'Don''t waste time unnecessarily by asking the team to repeat everything they have checked, just let them know you will go with their judgment as long as they accept responsibility for the decision.', '1', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(375, 52, 52, 12, 'Acknowledge that your arguments have been heard and discussed by the team, and support the team’s decision.', '5', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(376, 52, 52, 12, 'Ask the team to reconsider one more time your perspective on the long-term political impact of refusing the new product line because you feel it is an important issue.', '1', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(377, 52, 52, 12, 'Let the team know that although you believe in team unity, you can’t bring yourself to refuse the new product line.', '1', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(378, 52, 52, 12, 'Show your willingness to be a team player by voicing your support of the team’s decision. ', '5', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(379, 52, 52, 12, 'Recognize that the team has reviewed the issues, and begin discussing ways to make the recommendation to management.', '5', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(380, 52, 52, 12, 'Suggest that since the team can’t reach consensus they should allow upper management to make the final decision.', '1', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(381, 52, 52, 12, ') Even though you would still prefer to take on the new product line, go along with the team’s decision, because they have let you have your say in the matter.', '5', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(382, 52, 52, 12, 'Recognize that the team has some good arguments, but remain committed to making the team see that the benefits clearly outweigh the costs.', '1', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(383, 52, 52, 12, 'Sustain the team’s decision on the recommendation, as long as they acknowledge to upper management that the team would revisit its decision if more resources are provided.', '5', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
(384, 52, 52, 12, 'Be assertive and let the team know you still feel strongly that the team should take on the new product line.', '1', 0, 0, '2018-05-14 19:04:22', '2018-05-14 19:04:22'),
