(4200, 631, 629, 147, 'Immediately touch base with the other team members to find out who is the fastest at each of the manufacturing stations, and allocate tasks among you accordingly', '5', 0, 0, '2018-07-30 21:53:35', '2018-07-30 21:53:35'),
(4201, 631, 629, 147, 'Avoid being overly assertive in the new team and let others determine the team’s direction, because it is important that the younger members take the lead.', '4', 0, 0, '2018-07-30 21:53:35', '2018-07-30 21:53:35'),
(4202, 631, 629, 147, 'Quickly decide to continue with your planned production schedule because it probably won''t be possible to meet the rush order deadline.', '4', 0, 0, '2018-07-30 21:53:35', '2018-07-30 21:53:35'),
(4203, 631, 629, 147, 'Quickly meet with your team members to decide the priority that should be given to the "rush order".', '4', 0, 0, '2018-07-30 21:53:35', '2018-07-30 21:53:35'),
(4204, 631, 629, 147, 'Meet with each of the team members, encouraging them and clarifying what each will have to do in order to reach the deadline.', '4', 0, 0, '2018-07-30 21:53:35', '2018-07-30 21:53:35'),
(4205, 631, 629, 147, 'Gather the team together and map out a realistic timeline of what must be accomplished in order for the rush shipment to be completed.', '5', 0, 0, '2018-07-30 21:53:35', '2018-07-30 21:53:35'),
(4206, 631, 629, 147, 'Help the team stay calm by letting them know that they shouldn’t be too stressed about meeting the deadline because Sales knew that it was an unrealistic deadline when they made the commitment.', '5', 0, 0, '2018-07-30 21:53:35', '2018-07-30 21:53:35'),
(4207, 631, 629, 147, 'Try not to react too strongly to the news to help the new team members understand that this kind of rush order occurs far too often.', '4', 0, 0, '2018-07-30 21:53:35', '2018-07-30 21:53:35'),
(4208, 631, 629, 147, 'Let the team know that although you have not produced an order so quickly in the past, you are confident that by staying focused your team can ship the rush order on time.', '4', 0, 0, '2018-07-30 21:53:35', '2018-07-30 21:53:35'),
(4209, 631, 629, 147, 'Suggest that the deadline is unreasonable, and you will simply have to do your best without worrying about meeting the unrealistic shipment date to which the Sales department committed themselves.', '5', 0, 0, '2018-07-30 21:53:35', '2018-07-30 21:53:35'),
(4210, 631, 629, 147, 'Highlight the fact that you have been doing the job for 15 years and the current layout is the best one.', '5', 0, 0, '2018-07-30 21:53:35', '2018-07-30 21:53:35'),
(4211, 631, 629, 147, 'Propose that a good strategy may be to think outside of the box and get new layout ideas from high performance manufacturers in other industries.', '5', 0, 0, '2018-07-30 21:53:35', '2018-07-30 21:53:35'),
(4212, 631, 629, 147, 'Keep the team on track by pointing out that it is very inefficient to waste time discussing solutions that are probably not practically feasible.', '4', 0, 0, '2018-07-30 21:53:35', '2018-07-30 21:53:35'),
(4213, 631, 629, 147, 'Suggest that the team keep the ideas similar to the current layout to simplify the transition to the new building.', '4', 0, 0, '2018-07-30 21:53:35', '2018-07-30 21:53:35'),
(4214, 631, 629, 147, 'Suggest that to find the optimal layout, the team should first generate innovative ideas and save the evaluation of the ideas for later in the process.', '4', 0, 0, '2018-07-30 21:53:35', '2018-07-30 21:53:35'),
(4215, 631, 629, 147, 'Make sure the team doesn’t waste time discussing drastic changes to the current layout because management is not likely to endorse such a proposal anyway.', '5', 0, 0, '2018-07-30 21:53:35', '2018-07-30 21:53:35'),
(4216, 631, 629, 147, 'Make sure production levels don’t drop due to letting your team’s most creative member make all suggestions.', '5', 0, 0, '2018-07-30 21:53:35', '2018-07-30 21:53:35'),
(4217, 631, 629, 147, 'Remind the team that they have been working in the current environment for many years, and should consider all layout options even if they seem unfamiliar.', '5', 0, 0, '2018-07-30 21:53:35', '2018-07-30 21:53:35'),
(4218, 631, 629, 147, 'Recommend that each team member take time this week to create three layout designs and bring them to the next team meeting.', '4', 0, 0, '2018-07-30 21:53:35', '2018-07-30 21:53:35'),
(4219, 631, 629, 147, 'Suggest that a good way to generate innovative layouts would be to hold the next meeting in the new building.', '4', 0, 0, '2018-07-30 21:53:35', '2018-07-30 21:53:35'),
