(4336, 655, 653, 148, 'Immediately touch base with the other team members to find out who is the fastest at each of the manufacturing stations, and allocate tasks among you accordingly', '5', 0, 0, '2018-08-02 16:28:03', '2018-08-02 16:28:03'),
(4337, 655, 653, 148, 'Avoid being overly assertive in the new team and let others determine the team’s direction, because it is important that the younger members take the lead.', '5', 0, 0, '2018-08-02 16:28:03', '2018-08-02 16:28:03'),
(4338, 655, 653, 148, 'Quickly decide to continue with your planned production schedule because it probably won''t be possible to meet the rush order deadline.', '5', 0, 0, '2018-08-02 16:28:03', '2018-08-02 16:28:03'),
(4339, 655, 653, 148, 'Quickly meet with your team members to decide the priority that should be given to the "rush order".', '5', 0, 0, '2018-08-02 16:28:03', '2018-08-02 16:28:03'),
(4340, 655, 653, 148, 'Meet with each of the team members, encouraging them and clarifying what each will have to do in order to reach the deadline.', '5', 0, 0, '2018-08-02 16:28:03', '2018-08-02 16:28:03'),
(4341, 655, 653, 148, 'Gather the team together and map out a realistic timeline of what must be accomplished in order for the rush shipment to be completed.', '5', 0, 0, '2018-08-02 16:28:03', '2018-08-02 16:28:03'),
(4342, 655, 653, 148, 'Help the team stay calm by letting them know that they shouldn’t be too stressed about meeting the deadline because Sales knew that it was an unrealistic deadline when they made the commitment.', '5', 0, 0, '2018-08-02 16:28:03', '2018-08-02 16:28:03'),
(4343, 655, 653, 148, 'Try not to react too strongly to the news to help the new team members understand that this kind of rush order occurs far too often.', '4', 0, 0, '2018-08-02 16:28:03', '2018-08-02 16:28:03'),
(4344, 655, 653, 148, 'Let the team know that although you have not produced an order so quickly in the past, you are confident that by staying focused your team can ship the rush order on time.', '4', 0, 0, '2018-08-02 16:28:03', '2018-08-02 16:28:03'),
(4345, 655, 653, 148, 'Suggest that the deadline is unreasonable, and you will simply have to do your best without worrying about meeting the unrealistic shipment date to which the Sales department committed themselves.', '4', 0, 0, '2018-08-02 16:28:03', '2018-08-02 16:28:03'),
(4346, 655, 653, 148, 'Highlight the fact that you have been doing the job for 15 years and the current layout is the best one.', '5', 0, 0, '2018-08-02 16:28:03', '2018-08-02 16:28:03'),
(4347, 655, 653, 148, 'Propose that a good strategy may be to think outside of the box and get new layout ideas from high performance manufacturers in other industries.', '5', 0, 0, '2018-08-02 16:28:03', '2018-08-02 16:28:03'),
(4348, 655, 653, 148, 'Keep the team on track by pointing out that it is very inefficient to waste time discussing solutions that are probably not practically feasible.', '5', 0, 0, '2018-08-02 16:28:03', '2018-08-02 16:28:03'),
(4349, 655, 653, 148, 'Suggest that the team keep the ideas similar to the current layout to simplify the transition to the new building.', '5', 0, 0, '2018-08-02 16:28:03', '2018-08-02 16:28:03'),
(4350, 655, 653, 148, 'Suggest that to find the optimal layout, the team should first generate innovative ideas and save the evaluation of the ideas for later in the process.', '5', 0, 0, '2018-08-02 16:28:03', '2018-08-02 16:28:03'),
(4351, 655, 653, 148, 'Make sure the team doesn’t waste time discussing drastic changes to the current layout because management is not likely to endorse such a proposal anyway.', '5', 0, 0, '2018-08-02 16:28:03', '2018-08-02 16:28:03'),
(4352, 655, 653, 148, 'Make sure production levels don’t drop due to letting your team’s most creative member make all suggestions.', '5', 0, 0, '2018-08-02 16:28:03', '2018-08-02 16:28:03'),
(4353, 655, 653, 148, 'Remind the team that they have been working in the current environment for many years, and should consider all layout options even if they seem unfamiliar.', '5', 0, 0, '2018-08-02 16:28:03', '2018-08-02 16:28:03'),
(4354, 655, 653, 148, 'Recommend that each team member take time this week to create three layout designs and bring them to the next team meeting.', '5', 0, 0, '2018-08-02 16:28:03', '2018-08-02 16:28:03'),
(4355, 655, 653, 148, 'Suggest that a good way to generate innovative layouts would be to hold the next meeting in the new building.', '5', 0, 0, '2018-08-02 16:28:03', '2018-08-02 16:28:03'),
