(4593, 907, 905, 162, 'Recognize that the team has reviewed the issues, and begin discussing ways to make the recommendation to management.', '4', 0, 0, '2018-08-20 23:03:01', '2018-08-20 23:03:01'),
(4594, 907, 905, 162, 'Suggest that since the team can’t reach consensus they should allow upper management to make the final decision.', '4', 0, 0, '2018-08-20 23:03:01', '2018-08-20 23:03:01'),
(4595, 907, 905, 162, ') Even though you would still prefer to take on the new product line, go along with the team’s decision, because they have let you have your say in the matter.', '5', 0, 0, '2018-08-20 23:03:01', '2018-08-20 23:03:01'),
(4596, 907, 905, 162, 'Recognize that the team has some good arguments, but remain committed to making the team see that the benefits clearly outweigh the costs.', '5', 0, 0, '2018-08-20 23:03:01', '2018-08-20 23:03:01'),
(4597, 907, 905, 162, 'Sustain the team’s decision on the recommendation, as long as they acknowledge to upper management that the team would revisit its decision if more resources are provided.', '5', 0, 0, '2018-08-20 23:03:01', '2018-08-20 23:03:01'),
(4598, 907, 905, 162, 'Be assertive and let the team know you still feel strongly that the team should take on the new product line.', '5', 0, 0, '2018-08-20 23:03:01', '2018-08-20 23:03:01'),
