(4878, 980, 978, 165, 'Acknowledge that your arguments have been heard and discussed by the team, and support the team’s decision.', '5', 0, 0, '2018-08-21 21:06:29', '2018-08-21 21:06:29'),
(4879, 980, 978, 165, 'Ask the team to reconsider one more time your perspective on the long-term political impact of refusing the new product line because you feel it is an important issue.', '4', 0, 0, '2018-08-21 21:06:29', '2018-08-21 21:06:29'),
(4880, 980, 978, 165, 'Let the team know that although you believe in team unity, you can’t bring yourself to refuse the new product line.', '2', 0, 0, '2018-08-21 21:06:29', '2018-08-21 21:06:29'),
(4881, 980, 978, 165, 'Show your willingness to be a team player by voicing your support of the team’s decision. ', '5', 0, 0, '2018-08-21 21:06:29', '2018-08-21 21:06:29'),
(4882, 980, 978, 165, 'Recognize that the team has reviewed the issues, and begin discussing ways to make the recommendation to management.', '5', 0, 0, '2018-08-21 21:06:29', '2018-08-21 21:06:29'),
(4883, 980, 978, 165, 'Suggest that since the team can’t reach consensus they should allow upper management to make the final decision.', '2', 0, 0, '2018-08-21 21:06:29', '2018-08-21 21:06:29'),
(4884, 980, 978, 165, ') Even though you would still prefer to take on the new product line, go along with the team’s decision, because they have let you have your say in the matter.', '5', 0, 0, '2018-08-21 21:06:29', '2018-08-21 21:06:29'),
(4885, 980, 978, 165, 'Recognize that the team has some good arguments, but remain committed to making the team see that the benefits clearly outweigh the costs.', '2', 0, 0, '2018-08-21 21:06:29', '2018-08-21 21:06:29'),
(4886, 980, 978, 165, 'Sustain the team’s decision on the recommendation, as long as they acknowledge to upper management that the team would revisit its decision if more resources are provided.', '5', 0, 0, '2018-08-21 21:06:29', '2018-08-21 21:06:29'),
(4887, 980, 978, 165, 'Be assertive and let the team know you still feel strongly that the team should take on the new product line.', '2', 0, 0, '2018-08-21 21:06:29', '2018-08-21 21:06:29'),
(4888, 980, 978, 165, 'Immediately touch base with the other team members to find out who is the fastest at each of the manufacturing stations, and allocate tasks among you accordingly', '5', 0, 0, '2018-08-21 21:06:29', '2018-08-21 21:06:29'),
(4889, 980, 978, 165, 'Avoid being overly assertive in the new team and let others determine the team’s direction, because it is important that the younger members take the lead.', '1', 0, 0, '2018-08-21 21:06:29', '2018-08-21 21:06:29');
