(4890, 980, 978, 165, 'Quickly decide to continue with your planned production schedule because it probably won''t be possible to meet the rush order deadline.', '1', 0, 0, '2018-08-21 21:06:29', '2018-08-21 21:06:29'),
(4891, 980, 978, 165, 'Quickly meet with your team members to decide the priority that should be given to the "rush order".', '5', 0, 0, '2018-08-21 21:06:29', '2018-08-21 21:06:29'),
(4892, 980, 978, 165, 'Meet with each of the team members, encouraging them and clarifying what each will have to do in order to reach the deadline.', '5', 0, 0, '2018-08-21 21:06:29', '2018-08-21 21:06:29'),
(4893, 980, 978, 165, 'Gather the team together and map out a realistic timeline of what must be accomplished in order for the rush shipment to be completed.', '5', 0, 0, '2018-08-21 21:06:29', '2018-08-21 21:06:29'),
(4894, 980, 978, 165, 'Help the team stay calm by letting them know that they shouldn’t be too stressed about meeting the deadline because Sales knew that it was an unrealistic deadline when they made the commitment.', '1', 0, 0, '2018-08-21 21:06:29', '2018-08-21 21:06:29'),
(4895, 980, 978, 165, 'Try not to react too strongly to the news to help the new team members understand that this kind of rush order occurs far too often.', '1', 0, 0, '2018-08-21 21:06:29', '2018-08-21 21:06:29'),
(4896, 980, 978, 165, 'Let the team know that although you have not produced an order so quickly in the past, you are confident that by staying focused your team can ship the rush order on time.', '5', 0, 0, '2018-08-21 21:06:29', '2018-08-21 21:06:29'),
(4897, 980, 978, 165, 'Suggest that the deadline is unreasonable, and you will simply have to do your best without worrying about meeting the unrealistic shipment date to which the Sales department committed themselves.', '3', 0, 0, '2018-08-21 21:06:29', '2018-08-21 21:06:29'),
