(5157, 1029, 1027, 167, 'Make sure the team knows of potential risks and that it is critical that you are able to check for damage to the machine before any recommendation is made.', '5', 0, 0, '2018-08-22 02:30:19', '2018-08-22 02:30:19'),
(5158, 1029, 1027, 167, 'Support your team members in their decision, you’ve worked together for a long time, and trust their judgment.', '4', 0, 0, '2018-08-22 02:30:19', '2018-08-22 02:30:19'),
(5159, 1029, 1027, 167, 'Make sure the machine gets the job done on schedule by accepting the judgment of your experienced teammates.', '4', 0, 0, '2018-08-22 02:30:19', '2018-08-22 02:30:19'),
(5160, 1029, 1027, 167, 'Acknowledge that it’s likely that the electrical systems have not been damaged, but insist that you be given a chance to inspect the machine’s structural soundness yourself.', '5', 0, 0, '2018-08-22 02:30:19', '2018-08-22 02:30:19'),
(5161, 1029, 1027, 167, 'Tell the team about your experiences with similar accidents in the past and ask that you be able to inspect the machine personally before the recommendation is made.', '4', 0, 0, '2018-08-22 02:30:19', '2018-08-22 02:30:19'),
(5162, 1029, 1027, 167, 'Recommend that they go ahead and run the machine to support your team and then check its structural soundness after the important production run is finished.', '4', 0, 0, '2018-08-22 02:30:19', '2018-08-22 02:30:19'),
(5163, 1029, 1027, 167, 'Relate to the team some additional areas of potential damage to the machine after inquiring into the inspections they have made.', '5', 0, 0, '2018-08-22 02:30:19', '2018-08-22 02:30:19'),
(5164, 1029, 1027, 167, 'Although you are more experienced in the structural mechanics, go with the judgment made by your teammates because two of them have been with the company much longer than you have.', '4', 0, 0, '2018-08-22 02:30:19', '2018-08-22 02:30:19'),
(5165, 1029, 1027, 167, 'Thank the team for checking the machine over, but relate to the team your experience with "unseen damage" occurring even when it is not evident from an outside glance.', '5', 0, 0, '2018-08-22 02:30:19', '2018-08-22 02:30:19'),
(5166, 1029, 1027, 167, 'Don''t waste time unnecessarily by asking the team to repeat everything they have checked, just let them know you will go with their judgment as long as they accept responsibility for the decision.', '5', 0, 0, '2018-08-22 02:30:19', '2018-08-22 02:30:19'),
