(5405, 1076, NULL, 169, 'Guess Full Mapping: "[\\"B\\",\\"C\\",\\"E\\",\\"G\\",\\"A\\",\\"J\\",\\"D\\",\\"I\\",\\"H\\",\\"F\\"]"', 'A=4,B=0,C=1,D=6,E=2,F=9,G=3,H=8,I=7,J=5, Correct: 10', 1, 10, '2018-08-22 20:03:25', '2018-08-22 20:03:25'),
(5406, 1077, 1075, 169, 'Acknowledge that your arguments have been heard and discussed by the team, and support the team’s decision.', '5', 0, 0, '2018-08-22 20:04:30', '2018-08-22 20:04:30'),
(5407, 1077, 1075, 169, 'Ask the team to reconsider one more time your perspective on the long-term political impact of refusing the new product line because you feel it is an important issue.', '5', 0, 0, '2018-08-22 20:04:30', '2018-08-22 20:04:30'),
(5408, 1077, 1075, 169, 'Let the team know that although you believe in team unity, you can’t bring yourself to refuse the new product line.', '5', 0, 0, '2018-08-22 20:04:30', '2018-08-22 20:04:30'),
(5409, 1077, 1075, 169, 'Show your willingness to be a team player by voicing your support of the team’s decision. ', '5', 0, 0, '2018-08-22 20:04:30', '2018-08-22 20:04:30'),
(5410, 1077, 1075, 169, 'Recognize that the team has reviewed the issues, and begin discussing ways to make the recommendation to management.', '5', 0, 0, '2018-08-22 20:04:30', '2018-08-22 20:04:30'),
(5411, 1077, 1075, 169, 'Suggest that since the team can’t reach consensus they should allow upper management to make the final decision.', '5', 0, 0, '2018-08-22 20:04:30', '2018-08-22 20:04:30'),
(5412, 1077, 1075, 169, ') Even though you would still prefer to take on the new product line, go along with the team’s decision, because they have let you have your say in the matter.', '5', 0, 0, '2018-08-22 20:04:30', '2018-08-22 20:04:30'),
(5413, 1077, 1075, 169, 'Recognize that the team has some good arguments, but remain committed to making the team see that the benefits clearly outweigh the costs.', '5', 0, 0, '2018-08-22 20:04:30', '2018-08-22 20:04:30'),
(5414, 1077, 1075, 169, 'Sustain the team’s decision on the recommendation, as long as they acknowledge to upper management that the team would revisit its decision if more resources are provided.', '5', 0, 0, '2018-08-22 20:04:30', '2018-08-22 20:04:30'),
(5415, 1077, 1075, 169, 'Be assertive and let the team know you still feel strongly that the team should take on the new product line.', '5', 0, 0, '2018-08-22 20:04:30', '2018-08-22 20:04:30'),
(5416, 1077, 1075, 169, 'Immediately touch base with the other team members to find out who is the fastest at each of the manufacturing stations, and allocate tasks among you accordingly', '5', 0, 0, '2018-08-22 20:04:30', '2018-08-22 20:04:30'),
(5417, 1077, 1075, 169, 'Avoid being overly assertive in the new team and let others determine the team’s direction, because it is important that the younger members take the lead.', '5', 0, 0, '2018-08-22 20:04:30', '2018-08-22 20:04:30'),
(5418, 1077, 1075, 169, 'Quickly decide to continue with your planned production schedule because it probably won''t be possible to meet the rush order deadline.', '4', 0, 0, '2018-08-22 20:04:30', '2018-08-22 20:04:30'),
(5419, 1077, 1075, 169, 'Quickly meet with your team members to decide the priority that should be given to the "rush order".', '4', 0, 0, '2018-08-22 20:04:30', '2018-08-22 20:04:30'),
(5420, 1077, 1075, 169, 'Meet with each of the team members, encouraging them and clarifying what each will have to do in order to reach the deadline.', '3', 0, 0, '2018-08-22 20:04:30', '2018-08-22 20:04:30'),
(5421, 1077, 1075, 169, 'Gather the team together and map out a realistic timeline of what must be accomplished in order for the rush shipment to be completed.', '3', 0, 0, '2018-08-22 20:04:30', '2018-08-22 20:04:30'),
(5422, 1077, 1075, 169, 'Help the team stay calm by letting them know that they shouldn’t be too stressed about meeting the deadline because Sales knew that it was an unrealistic deadline when they made the commitment.', '3', 0, 0, '2018-08-22 20:04:30', '2018-08-22 20:04:30'),
(5423, 1077, 1075, 169, 'Try not to react too strongly to the news to help the new team members understand that this kind of rush order occurs far too often.', '3', 0, 0, '2018-08-22 20:04:30', '2018-08-22 20:04:30'),
(5424, 1077, 1075, 169, 'Let the team know that although you have not produced an order so quickly in the past, you are confident that by staying focused your team can ship the rush order on time.', '4', 0, 0, '2018-08-22 20:04:30', '2018-08-22 20:04:30'),
(5425, 1077, 1075, 169, 'Suggest that the deadline is unreasonable, and you will simply have to do your best without worrying about meeting the unrealistic shipment date to which the Sales department committed themselves.', '4', 0, 0, '2018-08-22 20:04:30', '2018-08-22 20:04:30'),
