(5582, 1128, 1126, 171, 'Immediately touch base with the other team members to find out who is the fastest at each of the manufacturing stations, and allocate tasks among you accordingly', '5', 0, 0, '2018-09-05 15:57:54', '2018-09-05 15:57:54'),
(5583, 1128, 1126, 171, 'Avoid being overly assertive in the new team and let others determine the team’s direction, because it is important that the younger members take the lead.', '5', 0, 0, '2018-09-05 15:57:54', '2018-09-05 15:57:54'),
(5584, 1128, 1126, 171, 'Quickly decide to continue with your planned production schedule because it probably won''t be possible to meet the rush order deadline.', '5', 0, 0, '2018-09-05 15:57:54', '2018-09-05 15:57:54'),
(5585, 1128, 1126, 171, 'Quickly meet with your team members to decide the priority that should be given to the "rush order".', '5', 0, 0, '2018-09-05 15:57:54', '2018-09-05 15:57:54'),
(5586, 1128, 1126, 171, 'Meet with each of the team members, encouraging them and clarifying what each will have to do in order to reach the deadline.', '5', 0, 0, '2018-09-05 15:57:54', '2018-09-05 15:57:54'),
(5587, 1128, 1126, 171, 'Gather the team together and map out a realistic timeline of what must be accomplished in order for the rush shipment to be completed.', '5', 0, 0, '2018-09-05 15:57:54', '2018-09-05 15:57:54'),
(5588, 1128, 1126, 171, 'Help the team stay calm by letting them know that they shouldn’t be too stressed about meeting the deadline because Sales knew that it was an unrealistic deadline when they made the commitment.', '5', 0, 0, '2018-09-05 15:57:54', '2018-09-05 15:57:54'),
(5589, 1128, 1126, 171, 'Try not to react too strongly to the news to help the new team members understand that this kind of rush order occurs far too often.', '5', 0, 0, '2018-09-05 15:57:54', '2018-09-05 15:57:54'),
(5590, 1128, 1126, 171, 'Let the team know that although you have not produced an order so quickly in the past, you are confident that by staying focused your team can ship the rush order on time.', '5', 0, 0, '2018-09-05 15:57:54', '2018-09-05 15:57:54'),
(5591, 1128, 1126, 171, 'Suggest that the deadline is unreasonable, and you will simply have to do your best without worrying about meeting the unrealistic shipment date to which the Sales department committed themselves.', '5', 0, 0, '2018-09-05 15:57:54', '2018-09-05 15:57:54'),
(5592, 1128, 1126, 171, 'Highlight the fact that you have been doing the job for 15 years and the current layout is the best one.', '3', 0, 0, '2018-09-05 15:57:54', '2018-09-05 15:57:54'),
(5593, 1128, 1126, 171, 'Propose that a good strategy may be to think outside of the box and get new layout ideas from high performance manufacturers in other industries.', '3', 0, 0, '2018-09-05 15:57:54', '2018-09-05 15:57:54'),
(5594, 1128, 1126, 171, 'Keep the team on track by pointing out that it is very inefficient to waste time discussing solutions that are probably not practically feasible.', '3', 0, 0, '2018-09-05 15:57:54', '2018-09-05 15:57:54'),
(5595, 1128, 1126, 171, 'Suggest that the team keep the ideas similar to the current layout to simplify the transition to the new building.', '3', 0, 0, '2018-09-05 15:57:54', '2018-09-05 15:57:54'),
(5596, 1128, 1126, 171, 'Suggest that to find the optimal layout, the team should first generate innovative ideas and save the evaluation of the ideas for later in the process.', '3', 0, 0, '2018-09-05 15:57:54', '2018-09-05 15:57:54'),
(5597, 1128, 1126, 171, 'Make sure the team doesn’t waste time discussing drastic changes to the current layout because management is not likely to endorse such a proposal anyway.', '3', 0, 0, '2018-09-05 15:57:54', '2018-09-05 15:57:54'),
(5598, 1128, 1126, 171, 'Make sure production levels don’t drop due to letting your team’s most creative member make all suggestions.', '3', 0, 0, '2018-09-05 15:57:54', '2018-09-05 15:57:54'),
(5599, 1128, 1126, 171, 'Remind the team that they have been working in the current environment for many years, and should consider all layout options even if they seem unfamiliar.', '3', 0, 0, '2018-09-05 15:57:54', '2018-09-05 15:57:54'),
(5600, 1128, 1126, 171, 'Recommend that each team member take time this week to create three layout designs and bring them to the next team meeting.', '3', 0, 0, '2018-09-05 15:57:54', '2018-09-05 15:57:54'),
(5601, 1128, 1126, 171, 'Suggest that a good way to generate innovative layouts would be to hold the next meeting in the new building.', '3', 0, 0, '2018-09-05 15:57:54', '2018-09-05 15:57:54'),
