(6042, 1288, 1286, 178, 'Make sure the team knows of potential risks and that it is critical that you are able to check for damage to the machine before any recommendation is made.', '5', 0, 0, '2018-09-12 18:06:59', '2018-09-12 18:06:59'),
(6043, 1288, 1286, 178, 'Support your team members in their decision, you’ve worked together for a long time, and trust their judgment.', '5', 0, 0, '2018-09-12 18:06:59', '2018-09-12 18:06:59'),
(6044, 1288, 1286, 178, 'Make sure the machine gets the job done on schedule by accepting the judgment of your experienced teammates.', '5', 0, 0, '2018-09-12 18:06:59', '2018-09-12 18:06:59'),
(6045, 1288, 1286, 178, 'Acknowledge that it’s likely that the electrical systems have not been damaged, but insist that you be given a chance to inspect the machine’s structural soundness yourself.', '5', 0, 0, '2018-09-12 18:06:59', '2018-09-12 18:06:59'),
(6046, 1288, 1286, 178, 'Tell the team about your experiences with similar accidents in the past and ask that you be able to inspect the machine personally before the recommendation is made.', '5', 0, 0, '2018-09-12 18:06:59', '2018-09-12 18:06:59'),
(6047, 1288, 1286, 178, 'Recommend that they go ahead and run the machine to support your team and then check its structural soundness after the important production run is finished.', '5', 0, 0, '2018-09-12 18:06:59', '2018-09-12 18:06:59'),
(6048, 1288, 1286, 178, 'Relate to the team some additional areas of potential damage to the machine after inquiring into the inspections they have made.', '5', 0, 0, '2018-09-12 18:06:59', '2018-09-12 18:06:59'),
(6049, 1288, 1286, 178, 'Although you are more experienced in the structural mechanics, go with the judgment made by your teammates because two of them have been with the company much longer than you have.', '5', 0, 0, '2018-09-12 18:06:59', '2018-09-12 18:06:59'),
(6050, 1288, 1286, 178, 'Thank the team for checking the machine over, but relate to the team your experience with "unseen damage" occurring even when it is not evident from an outside glance.', '5', 0, 0, '2018-09-12 18:06:59', '2018-09-12 18:06:59'),
(6051, 1288, 1286, 178, 'Don''t waste time unnecessarily by asking the team to repeat everything they have checked, just let them know you will go with their judgment as long as they accept responsibility for the decision.', '5', 0, 0, '2018-09-12 18:06:59', '2018-09-12 18:06:59'),
(6052, 1288, 1286, 178, 'Acknowledge that your arguments have been heard and discussed by the team, and support the team’s decision.', '5', 0, 0, '2018-09-12 18:06:59', '2018-09-12 18:06:59'),
(6053, 1288, 1286, 178, 'Ask the team to reconsider one more time your perspective on the long-term political impact of refusing the new product line because you feel it is an important issue.', '4', 0, 0, '2018-09-12 18:06:59', '2018-09-12 18:06:59'),
(6054, 1288, 1286, 178, 'Let the team know that although you believe in team unity, you can’t bring yourself to refuse the new product line.', '4', 0, 0, '2018-09-12 18:06:59', '2018-09-12 18:06:59'),
(6055, 1288, 1286, 178, 'Show your willingness to be a team player by voicing your support of the team’s decision. ', '4', 0, 0, '2018-09-12 18:06:59', '2018-09-12 18:06:59'),
(6056, 1288, 1286, 178, 'Recognize that the team has reviewed the issues, and begin discussing ways to make the recommendation to management.', '4', 0, 0, '2018-09-12 18:06:59', '2018-09-12 18:06:59'),
(6057, 1288, 1286, 178, 'Suggest that since the team can’t reach consensus they should allow upper management to make the final decision.', '4', 0, 0, '2018-09-12 18:06:59', '2018-09-12 18:06:59'),
(6058, 1288, 1286, 178, 'Even though you would still prefer to take on the new product line, go along with the team’s decision, because they have let you have your say in the matter.', '4', 0, 0, '2018-09-12 18:06:59', '2018-09-12 18:06:59'),
(6059, 1288, 1286, 178, 'Recognize that the team has some good arguments, but remain committed to making the team see that the benefits clearly outweigh the costs.', '4', 0, 0, '2018-09-12 18:06:59', '2018-09-12 18:06:59'),
(6060, 1288, 1286, 178, 'Sustain the team’s decision on the recommendation, as long as they acknowledge to upper management that the team would revisit its decision if more resources are provided.', '5', 0, 0, '2018-09-12 18:06:59', '2018-09-12 18:06:59'),
