(6326, 1354, 1352, 181, 'Acknowledge that your arguments have been heard and discussed by the team, and support the team’s decision.', '5', 0, 0, '2018-09-17 20:12:18', '2018-09-17 20:12:18'),
(6327, 1354, 1352, 181, 'Ask the team to reconsider one more time your perspective on the long-term political impact of refusing the new product line because you feel it is an important issue.', '5', 0, 0, '2018-09-17 20:12:18', '2018-09-17 20:12:18'),
(6328, 1354, 1352, 181, 'Let the team know that although you believe in team unity, you can’t bring yourself to refuse the new product line.', '5', 0, 0, '2018-09-17 20:12:18', '2018-09-17 20:12:18'),
(6329, 1354, 1352, 181, 'Show your willingness to be a team player by voicing your support of the team’s decision. ', '5', 0, 0, '2018-09-17 20:12:18', '2018-09-17 20:12:18'),
(6330, 1354, 1352, 181, 'Recognize that the team has reviewed the issues, and begin discussing ways to make the recommendation to management.', '5', 0, 0, '2018-09-17 20:12:18', '2018-09-17 20:12:18'),
(6331, 1354, 1352, 181, 'Suggest that since the team can’t reach consensus they should allow upper management to make the final decision.', '5', 0, 0, '2018-09-17 20:12:18', '2018-09-17 20:12:18'),
(6332, 1354, 1352, 181, 'Even though you would still prefer to take on the new product line, go along with the team’s decision, because they have let you have your say in the matter.', '5', 0, 0, '2018-09-17 20:12:18', '2018-09-17 20:12:18'),
(6333, 1354, 1352, 181, 'Recognize that the team has some good arguments, but remain committed to making the team see that the benefits clearly outweigh the costs.', '5', 0, 0, '2018-09-17 20:12:18', '2018-09-17 20:12:18'),
(6334, 1354, 1352, 181, 'Sustain the team’s decision on the recommendation, as long as they acknowledge to upper management that the team would revisit its decision if more resources are provided.', '5', 0, 0, '2018-09-17 20:12:18', '2018-09-17 20:12:18'),
(6335, 1354, 1352, 181, 'Be assertive and let the team know you still feel strongly that the team should take on the new product line.', '5', 0, 0, '2018-09-17 20:12:18', '2018-09-17 20:12:18'),
(6336, 1354, 1352, 181, 'Immediately touch base with the other team members to find out who is the fastest at each of the manufacturing stations, and allocate tasks among you accordingly', '5', 0, 0, '2018-09-17 20:12:18', '2018-09-17 20:12:18'),
(6337, 1354, 1352, 181, 'Avoid being overly assertive in the new team and let others determine the team’s direction, because it is important that the younger members take the lead.', '5', 0, 0, '2018-09-17 20:12:18', '2018-09-17 20:12:18'),
(6338, 1354, 1352, 181, 'Quickly decide to continue with your planned production schedule because it probably won''t be possible to meet the rush order deadline.', '5', 0, 0, '2018-09-17 20:12:18', '2018-09-17 20:12:18'),
(6339, 1354, 1352, 181, 'Quickly meet with your team members to decide the priority that should be given to the "rush order".', '5', 0, 0, '2018-09-17 20:12:18', '2018-09-17 20:12:18'),
(6340, 1354, 1352, 181, 'Meet with each of the team members, encouraging them and clarifying what each will have to do in order to reach the deadline.', '5', 0, 0, '2018-09-17 20:12:18', '2018-09-17 20:12:18'),
(6341, 1354, 1352, 181, 'Gather the team together and map out a realistic timeline of what must be accomplished in order for the rush shipment to be completed.', '5', 0, 0, '2018-09-17 20:12:18', '2018-09-17 20:12:18'),
(6342, 1354, 1352, 181, 'Help the team stay calm by letting them know that they shouldn’t be too stressed about meeting the deadline because Sales knew that it was an unrealistic deadline when they made the commitment.', '5', 0, 0, '2018-09-17 20:12:18', '2018-09-17 20:12:18'),
(6343, 1354, 1352, 181, 'Try not to react too strongly to the news to help the new team members understand that this kind of rush order occurs far too often.', '5', 0, 0, '2018-09-17 20:12:18', '2018-09-17 20:12:18'),
(6344, 1354, 1352, 181, 'Let the team know that although you have not produced an order so quickly in the past, you are confident that by staying focused your team can ship the rush order on time.', '5', 0, 0, '2018-09-17 20:12:18', '2018-09-17 20:12:18'),
(6345, 1354, 1352, 181, 'Suggest that the deadline is unreasonable, and you will simply have to do your best without worrying about meeting the unrealistic shipment date to which the Sales department committed themselves.', '5', 0, 0, '2018-09-17 20:12:18', '2018-09-17 20:12:18'),
