(6795, 1609, 1600, 212, 'Immediately touch base with the other team members to find out who is the fastest at each of the manufacturing stations, and allocate tasks among you accordingly', '5', 0, 2, '2018-10-18 15:32:58', '2018-10-18 15:32:58'),
(6796, 1609, 1600, 212, 'Avoid being overly assertive in the new team and let others determine the team’s direction, because it is important that the younger members take the lead.', '5', 0, -2, '2018-10-18 15:32:58', '2018-10-18 15:32:58'),
(6797, 1609, 1600, 212, 'Quickly decide to continue with your planned production schedule because it probably won''t be possible to meet the rush order deadline.', '5', 0, -2, '2018-10-18 15:32:58', '2018-10-18 15:32:58'),
(6798, 1609, 1600, 212, 'Quickly meet with your team members to decide the priority that should be given to the "rush order".', '5', 0, 2, '2018-10-18 15:32:58', '2018-10-18 15:32:58'),
(6799, 1609, 1600, 212, 'Meet with each of the team members, encouraging them and clarifying what each will have to do in order to reach the deadline.', '5', 0, 2, '2018-10-18 15:32:58', '2018-10-18 15:32:58'),
(6800, 1609, 1600, 212, 'Gather the team together and map out a realistic timeline of what must be accomplished in order for the rush shipment to be completed.', '5', 0, 2, '2018-10-18 15:32:58', '2018-10-18 15:32:58'),
(6801, 1609, 1600, 212, 'Help the team stay calm by letting them know that they shouldn’t be too stressed about meeting the deadline because Sales knew that it was an unrealistic deadline when they made the commitment.', '5', 0, -2, '2018-10-18 15:32:58', '2018-10-18 15:32:58'),
(6802, 1609, 1600, 212, 'Try not to react too strongly to the news to help the new team members understand that this kind of rush order occurs far too often.', '5', 0, -2, '2018-10-18 15:32:58', '2018-10-18 15:32:58'),
(6803, 1609, 1600, 212, 'Let the team know that although you have not produced an order so quickly in the past, you are confident that by staying focused your team can ship the rush order on time.', '5', 0, 2, '2018-10-18 15:32:58', '2018-10-18 15:32:58'),
(6804, 1609, 1600, 212, 'Suggest that the deadline is unreasonable, and you will simply have to do your best without worrying about meeting the unrealistic shipment date to which the Sales department committed themselves.', '5', 0, -2, '2018-10-18 15:32:58', '2018-10-18 15:32:58'),
(6805, 1609, 1600, 212, 'Highlight the fact that you have been doing the job for 15 years and the current layout is the best one.', '5', 0, -2, '2018-10-18 15:32:58', '2018-10-18 15:32:58'),
(6806, 1609, 1600, 212, 'Propose that a good strategy may be to think outside of the box and get new layout ideas from high performance manufacturers in other industries.', '5', 0, 2, '2018-10-18 15:32:58', '2018-10-18 15:32:58'),
(6807, 1609, 1600, 212, 'Keep the team on track by pointing out that it is very inefficient to waste time discussing solutions that are probably not practically feasible.', '5', 0, -2, '2018-10-18 15:32:58', '2018-10-18 15:32:58'),
(6808, 1609, 1600, 212, 'Suggest that the team keep the ideas similar to the current layout to simplify the transition to the new building.', '5', 0, -2, '2018-10-18 15:32:58', '2018-10-18 15:32:58'),
(6809, 1609, 1600, 212, 'Suggest that to find the optimal layout, the team should first generate innovative ideas and save the evaluation of the ideas for later in the process.', '5', 0, 2, '2018-10-18 15:32:58', '2018-10-18 15:32:58'),
(6810, 1609, 1600, 212, 'Make sure the team doesn’t waste time discussing drastic changes to the current layout because management is not likely to endorse such a proposal anyway.', '5', 0, -2, '2018-10-18 15:32:58', '2018-10-18 15:32:58'),
(6811, 1609, 1600, 212, 'Make sure production levels don’t drop due to letting your team’s most creative member make all suggestions.', '5', 0, -2, '2018-10-18 15:32:58', '2018-10-18 15:32:58'),
(6812, 1609, 1600, 212, 'Remind the team that they have been working in the current environment for many years, and should consider all layout options even if they seem unfamiliar.', '5', 0, 2, '2018-10-18 15:32:58', '2018-10-18 15:32:58'),
(6813, 1609, 1600, 212, 'Recommend that each team member take time this week to create three layout designs and bring them to the next team meeting.', '5', 0, 2, '2018-10-18 15:32:58', '2018-10-18 15:32:58'),
(6814, 1609, 1600, 212, 'Suggest that a good way to generate innovative layouts would be to hold the next meeting in the new building.', '5', 0, 2, '2018-10-18 15:32:58', '2018-10-18 15:32:58'),
