(6970, 1635, 1626, 213, 'Highlight the fact that you have been doing the job for 15 years and the current layout is the best one.', '5', 0, -2, '2018-10-18 16:01:12', '2018-10-18 16:01:12'),
(6971, 1635, 1626, 213, 'Propose that a good strategy may be to think outside of the box and get new layout ideas from high performance manufacturers in other industries.', '5', 0, 2, '2018-10-18 16:01:12', '2018-10-18 16:01:12'),
(6972, 1635, 1626, 213, 'Keep the team on track by pointing out that it is very inefficient to waste time discussing solutions that are probably not practically feasible.', '5', 0, -2, '2018-10-18 16:01:12', '2018-10-18 16:01:12'),
(6973, 1635, 1626, 213, 'Suggest that the team keep the ideas similar to the current layout to simplify the transition to the new building.', '5', 0, -2, '2018-10-18 16:01:12', '2018-10-18 16:01:12'),
(6974, 1635, 1626, 213, 'Suggest that to find the optimal layout, the team should first generate innovative ideas and save the evaluation of the ideas for later in the process.', '5', 0, 2, '2018-10-18 16:01:12', '2018-10-18 16:01:12'),
(6975, 1635, 1626, 213, 'Make sure the team doesn’t waste time discussing drastic changes to the current layout because management is not likely to endorse such a proposal anyway.', '5', 0, -2, '2018-10-18 16:01:12', '2018-10-18 16:01:12'),
(6976, 1635, 1626, 213, 'Make sure production levels don’t drop due to letting your team’s most creative member make all suggestions.', '5', 0, -2, '2018-10-18 16:01:12', '2018-10-18 16:01:12'),
(6977, 1635, 1626, 213, 'Remind the team that they have been working in the current environment for many years, and should consider all layout options even if they seem unfamiliar.', '5', 0, 2, '2018-10-18 16:01:12', '2018-10-18 16:01:12'),
(6978, 1635, 1626, 213, 'Recommend that each team member take time this week to create three layout designs and bring them to the next team meeting.', '5', 0, 2, '2018-10-18 16:01:12', '2018-10-18 16:01:12'),
(6979, 1635, 1626, 213, 'Suggest that a good way to generate innovative layouts would be to hold the next meeting in the new building.', '5', 0, 2, '2018-10-18 16:01:12', '2018-10-18 16:01:12'),
(6980, 1635, 1626, 213, 'Make sure the team knows of potential risks and that it is critical that you are able to check for damage to the machine before any recommendation is made.', '5', 0, 2, '2018-10-18 16:01:12', '2018-10-18 16:01:12'),
(6981, 1635, 1626, 213, 'Support your team members in their decision, you’ve worked together for a long time, and trust their judgment.', '5', 0, -2, '2018-10-18 16:01:12', '2018-10-18 16:01:12'),
(6982, 1635, 1626, 213, 'Make sure the machine gets the job done on schedule by accepting the judgment of your experienced teammates.', '5', 0, -2, '2018-10-18 16:01:12', '2018-10-18 16:01:12'),
(6983, 1635, 1626, 213, 'Acknowledge that it’s likely that the electrical systems have not been damaged, but insist that you be given a chance to inspect the machine’s structural soundness yourself.', '5', 0, 2, '2018-10-18 16:01:12', '2018-10-18 16:01:12'),
(6984, 1635, 1626, 213, 'Tell the team about your experiences with similar accidents in the past and ask that you be able to inspect the machine personally before the recommendation is made.', '5', 0, 2, '2018-10-18 16:01:12', '2018-10-18 16:01:12'),
(6985, 1635, 1626, 213, 'Recommend that they go ahead and run the machine to support your team and then check its structural soundness after the important production run is finished.', '5', 0, -2, '2018-10-18 16:01:12', '2018-10-18 16:01:12'),
(6986, 1635, 1626, 213, 'Relate to the team some additional areas of potential damage to the machine after inquiring into the inspections they have made.', '5', 0, 2, '2018-10-18 16:01:12', '2018-10-18 16:01:12'),
(6987, 1635, 1626, 213, 'Although you are more experienced in the structural mechanics, go with the judgment made by your teammates because two of them have been with the company much longer than you have.', '5', 0, -2, '2018-10-18 16:01:12', '2018-10-18 16:01:12'),
(6988, 1635, 1626, 213, 'Thank the team for checking the machine over, but relate to the team your experience with "unseen damage" occurring even when it is not evident from an outside glance.', '5', 0, 2, '2018-10-18 16:01:12', '2018-10-18 16:01:12'),
(6989, 1635, 1626, 213, 'Don''t waste time unnecessarily by asking the team to repeat everything they have checked, just let them know you will go with their judgment as long as they accept responsibility for the decision.', '5', 0, -2, '2018-10-18 16:01:12', '2018-10-18 16:01:12'),
