(7626, 1817, 1808, 230, 'Immediately touch base with the other team members to find out who is the fastest at each of the manufacturing stations, and allocate tasks among you accordingly', '5', 0, 2, '2018-11-05 20:16:21', '2018-11-05 20:16:21'),
(7627, 1817, 1808, 230, 'Avoid being overly assertive in the new team and let others determine the team’s direction, because it is important that the younger members take the lead.', '5', 0, -2, '2018-11-05 20:16:21', '2018-11-05 20:16:21'),
(7628, 1817, 1808, 230, 'Quickly decide to continue with your planned production schedule because it probably won''t be possible to meet the rush order deadline.', '5', 0, -2, '2018-11-05 20:16:21', '2018-11-05 20:16:21'),
(7629, 1817, 1808, 230, 'Quickly meet with your team members to decide the priority that should be given to the "rush order".', '5', 0, 2, '2018-11-05 20:16:21', '2018-11-05 20:16:21'),
(7630, 1817, 1808, 230, 'Meet with each of the team members, encouraging them and clarifying what each will have to do in order to reach the deadline.', '5', 0, 2, '2018-11-05 20:16:21', '2018-11-05 20:16:21'),
(7631, 1817, 1808, 230, 'Gather the team together and map out a realistic timeline of what must be accomplished in order for the rush shipment to be completed.', '5', 0, 2, '2018-11-05 20:16:21', '2018-11-05 20:16:21'),
(7632, 1817, 1808, 230, 'Help the team stay calm by letting them know that they shouldn’t be too stressed about meeting the deadline because Sales knew that it was an unrealistic deadline when they made the commitment.', '5', 0, -2, '2018-11-05 20:16:21', '2018-11-05 20:16:21'),
(7633, 1817, 1808, 230, 'Try not to react too strongly to the news to help the new team members understand that this kind of rush order occurs far too often.', '5', 0, -2, '2018-11-05 20:16:21', '2018-11-05 20:16:21'),
(7634, 1817, 1808, 230, 'Let the team know that although you have not produced an order so quickly in the past, you are confident that by staying focused your team can ship the rush order on time.', '5', 0, 2, '2018-11-05 20:16:21', '2018-11-05 20:16:21'),
(7635, 1817, 1808, 230, 'Suggest that the deadline is unreasonable, and you will simply have to do your best without worrying about meeting the unrealistic shipment date to which the Sales department committed themselves.', '5', 0, -2, '2018-11-05 20:16:21', '2018-11-05 20:16:21'),
(7636, 1817, 1808, 230, 'Highlight the fact that you have been doing the job for 15 years and the current layout is the best one.', '5', 0, -2, '2018-11-05 20:16:21', '2018-11-05 20:16:21'),
(7637, 1817, 1808, 230, 'Propose that a good strategy may be to think outside of the box and get new layout ideas from high performance manufacturers in other industries.', '5', 0, 2, '2018-11-05 20:16:21', '2018-11-05 20:16:21'),
(7638, 1817, 1808, 230, 'Keep the team on track by pointing out that it is very inefficient to waste time discussing solutions that are probably not practically feasible.', '5', 0, -2, '2018-11-05 20:16:21', '2018-11-05 20:16:21'),
(7639, 1817, 1808, 230, 'Suggest that the team keep the ideas similar to the current layout to simplify the transition to the new building.', '5', 0, -2, '2018-11-05 20:16:21', '2018-11-05 20:16:21'),
(7640, 1817, 1808, 230, 'Suggest that to find the optimal layout, the team should first generate innovative ideas and save the evaluation of the ideas for later in the process.', '5', 0, 2, '2018-11-05 20:16:21', '2018-11-05 20:16:21');
