(7641, 1817, 1808, 230, 'Make sure the team doesn’t waste time discussing drastic changes to the current layout because management is not likely to endorse such a proposal anyway.', '5', 0, -2, '2018-11-05 20:16:21', '2018-11-05 20:16:21'),
(7642, 1817, 1808, 230, 'Make sure production levels don’t drop due to letting your team’s most creative member make all suggestions.', '5', 0, -2, '2018-11-05 20:16:21', '2018-11-05 20:16:21'),
(7643, 1817, 1808, 230, 'Remind the team that they have been working in the current environment for many years, and should consider all layout options even if they seem unfamiliar.', '5', 0, 2, '2018-11-05 20:16:21', '2018-11-05 20:16:21'),
(7644, 1817, 1808, 230, 'Recommend that each team member take time this week to create three layout designs and bring them to the next team meeting.', '5', 0, 2, '2018-11-05 20:16:21', '2018-11-05 20:16:21'),
(7645, 1817, 1808, 230, 'Suggest that a good way to generate innovative layouts would be to hold the next meeting in the new building.', '5', 0, 2, '2018-11-05 20:16:21', '2018-11-05 20:16:21'),
